const Login = ({onLogin})=> {
    const [username, setUsername] = useState ('');
    const [password, setPassword] = useState ('');

    const handleLogin = () => {
        if (username&&password) {
            onLogin(username);
        }else{
            alert('')
        };
    }
return(

    <div>
  <div className="background">
    <div className="shapee" />
    <div className="shapee" />
  </div>
  <form className="formm">
    <h3>Login Here</h3>
    <label htmlFor="username" className="formm">Username</label>
    <input type="text" placeholder="Username" value = {username} onChange={(e)=> setUsername(e.target.value)}  class="formm"/>
    <label htmlFor="password" className="formm">Password</label>
    <input type="password" placeholder="Password" value = {password} onChange={(e)=> setPassword(e.target.value)} class="formm"/>
    <button className="formm" type="button" onclick="{handleLogin}">Log In</button>
  </form>
</div>


